import { Colors } from 'react-native/Libraries/NewAppScreen';



export default function App() {

  return (

    <View style={styles.container}>
      <View style={styles.header}>
        <Text ></Text>
      </View>

      <View style={styles.feed}>
        <Text>Feed</Text>
      </View>

      <View style={styles.footer}>
        <Text>Footer</Text>
      </View>

      <StatusBar style='auto' />
    </View>

  );
}

